-- ----------------------------
-- Table structure for email_task
-- ----------------------------
DROP TABLE IF EXISTS `email_task`;
CREATE TABLE `email_task` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) NOT NULL COMMENT '邮件任务名称',
  `creater_id` int(11) NOT NULL COMMENT '创建人id',
  `file_path` varchar(255) NOT NULL COMMENT '任务的文件保存路径',
  `excel_file` varchar(255) NOT NULL COMMENT 'excel文件名',
  `start_line` int(11) NOT NULL DEFAULT '0' COMMENT '开始行号',
  `total_emails` int(11) DEFAULT '0' COMMENT '总共需要发的邮件数量',
  `succeed_emails` int(11) DEFAULT '0' COMMENT '发送成功的邮件数量',
  `failed_emails` int(11) DEFAULT '0' COMMENT '发送失败的邮件数量',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  `update_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '更新时间',
  `status` tinyint(4) NOT NULL DEFAULT '2' COMMENT '任务状态（0：无效；1：未就绪；2：待执行；3：执行中；4：执行完成）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=64 DEFAULT CHARSET=utf8 COMMENT='邮件任务表';

-- ----------------------------
-- Records of email_task
-- ----------------------------

-- ----------------------------
-- Table structure for task_result
-- ----------------------------
DROP TABLE IF EXISTS `task_result`;
CREATE TABLE `task_result` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL COMMENT '任务id',
  `to` varchar(255) DEFAULT NULL COMMENT '收件人邮箱',
  `subject` varchar(255) DEFAULT NULL COMMENT '邮件主题',
  `body` text COMMENT '邮件正文',
  `attachments` varchar(255) DEFAULT NULL COMMENT '附件名称（多个附件以";"分隔）',
  `msg` varchar(255) DEFAULT '' COMMENT '信息（通常为发送失败的原因）',
  `is_read` tinyint(4) DEFAULT '0' COMMENT '收件人是否已读（0：否；1：是）',
  `read_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP COMMENT '阅读时间',
  `status` tinyint(4) DEFAULT '1' COMMENT '状态',
  `create_time` timestamp NULL DEFAULT CURRENT_TIMESTAMP COMMENT '创建时间',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6071 DEFAULT CHARSET=utf8;

-- ----------------------------
-- Records of task_result
-- ----------------------------

-- ----------------------------
-- Table structure for task_template
-- ----------------------------
DROP TABLE IF EXISTS `task_template`;
CREATE TABLE `task_template` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL COMMENT '任务id',
  `to_excel_col` int(255) DEFAULT NULL COMMENT '收件人地址对应Excel文件中的栏位序号（从1开始）',
  `subject` varchar(255) DEFAULT '' COMMENT '邮件主题',
  `body` text COMMENT '邮件正文',
  `attachment_type` tinyint(4) NOT NULL DEFAULT '0' COMMENT '附件类型（0：不发送附件；1：所有收件人发送相同附件；2：不同收件人发送不同附件）',
  `attachment_excel_col` int(11) DEFAULT NULL COMMENT '附件名称对应Excel文件中的栏位序号（从1开始）',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=45 DEFAULT CHARSET=utf8 COMMENT='邮件任务对应的邮件模板表';

-- ----------------------------
-- Records of task_template
-- ----------------------------

-- ----------------------------
-- Table structure for task_transport
-- ----------------------------
DROP TABLE IF EXISTS `task_transport`;
CREATE TABLE `task_transport` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `task_id` int(11) NOT NULL COMMENT '任务id',
  `smtp` varchar(255) NOT NULL COMMENT '发件服务器地址',
  `port` int(11) NOT NULL DEFAULT '25' COMMENT '发件服务器端口',
  `encryption` varchar(255) NOT NULL DEFAULT '' COMMENT '加密方式',
  `sender_email` varchar(255) NOT NULL DEFAULT '' COMMENT '发件邮箱',
  `sender_email_password` varchar(255) NOT NULL DEFAULT '' COMMENT '发件邮箱密码',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=46 DEFAULT CHARSET=utf8 COMMENT='邮件任务的transport配置表';

